const Notification = () => {
  return (
    <>
      {CardData.map((val, i) => {
        return (
          <Card
            key={i}
            img={val.img}
            name={val.name}
            text={val.text}
            time={val.time}
          />
        );
      })}
    </>
  );
};
export default Notification;
